    changes in Jackson county and Walden, Colorado due to the establishment and presence
    of Arapahoe NWR. Concerns were voiced to the USFWS regarding the reduction of cattle
    and hay production and increasing migratory bird activities due to the creation
    of Arapahoe NWR. A history of Arapahoe NWR and Jackson County are given, as well
    as an analysis of the economic and social impacts from the refuge. Recommendations
